July 14, 2020 at 6am Bob, Meg, Echo with Rati

출연(Starring)..
밥 Bob, 매그 Meg, 에코 Echo, 래티 Rati, Featuring Andrew

Story..
2020년 7월 14일 화요일 6am. 아침 산책길에 Bob과 Meg 그리고 Echo를 만났어요. 서로 너무나 재미있게 놀고 있어서 한참을 넋 놓고 보고 있는데, 갑자기 귀염둥이들의 이복형인 Rati가 난입하여 모두들 감짝 놀랐어요. 동생들 노는 모습을 한참 동안 부러운 듯 바라보던 Rati. 항상 외톨이로 지내온 Rati를 생각하니 갑자기 마음이 짠해졌어요. Rati와 동생들의 즐거운 한때. 재미있게 감상해 보세요. 감사합니다

July 14, 2020 at 6am. I met Bob, Meg and Echo on the morning promenade. They are having so much fun with each other that I am staring at each other for a long time, and suddenly Rati who half-brother of the cuties, broke in and everyone was surprised. Rati looked at his younger brothers playing with envy for a long time. Thinking of Rati who has always been alone, suddenly broke my heart. A fun time for Rati and his brothers. Have fun and enjoy it. Thank you.

